import React from "react";

function Menu(prop){
    if (prop.name==='Juan'){
        return (<div>Hola Juan</div>)
    } else {
        return (
        <div>
            <button> Ingresar </button>
            <button> Registrar </button>
        </div>)
    }
}

export default Menu;
